export default function foundname(){
    const cargoUtil = window.sessionStorage.getItem('jwt');
    alert(cargoUtil);
    return fetch("http://localhost/foundname.php",{
        method:"POST",
        headers: {
            "Content-Type":'application/json'
        },
        body: cargoUtil
    }).then(res=>res.json()
    ).then((res)=> {return res});
}
